add error handling in your task loop like try-catch around training code and log errors to catch what’s breaking, then restart tasks on failure automatically. like this. 
```js
try {
  await runTrainingTask(task)
} catch (err) {
  console.error('Task failed:', err)
  retryTask(task)
}
```

